import React from 'react';
import SpeechComponent from './SpeechComponent';

const SearchBarComponent = () => {

    return(
        <>
            <p>Search:</p>
            <input type="text" placeholder="e.g. flu" />
            <input type="submit" />
            <SpeechComponent></SpeechComponent>
        </>
    )
}

export default SearchBarComponent;
